using System;
using BepInEx;
using UnityEngine;
using UnityEngine.SceneManagement;
using System.IO;

[BepInPlugin("moldygh.bbp.danceparty", "Baldi's Dance Party", "1.0.0.0")]
public class Main : BaseUnityPlugin
{
    public const string thingimage = "";
    public static Sprite thingsprite;

    public Texture bambifucker;

    public static int sampleRate = 44100;

    // fasguy wrote this lol
    private static Texture ConvertFromBase64(string base64)
    {
        byte[] array = Convert.FromBase64String(base64);
        Texture2D texture2D = new Texture2D(1, 1, TextureFormat.RGBA32, false);
        ImageConversion.LoadImage(texture2D, array);
        texture2D.filterMode = 0;
        return texture2D;
    }
    void Awake()
    {
        Texture tex = ConvertFromBase64(thingimage);
        thingsprite = Sprite.Create((Texture2D)tex, new Rect(0f, 0f, tex.width, tex.height), new Vector2(0.5f, 0.5f));
        bambifucker = tex;
    }
    void Update()
    {
        float fov = Mathf.Clamp(Mathf.Sin(Time.frameCount / 30f) * 60f, 20, 60);

        Camera.main.fieldOfView = fov;
        string curSceneName = SceneManager.GetActiveScene().name;
        bool hasDone = false;
        if(curSceneName == "Game" && !hasDone)
        {
            SpriteRenderer[] renderers = Resources.FindObjectsOfTypeAll<SpriteRenderer>();
            Material[] materials = Resources.FindObjectsOfTypeAll<Material>();
            int index = renderers.Length;
            int index2 = materials.Length;

            for (int i = 0; i < renderers.Length; i++)
            {
                renderers[i].sprite = thingsprite;
                index--;
            }
            for (int i = 0; i < materials.Length; i++)
            {
                materials[i].mainTexture = bambifucker;
            }
            if(index == 0 && index2 == 0)
            {
                hasDone = true;
            }
        }
    }
}
